/**
 * Addming partical rain effect to an image.
 */

// new image object, image1
const image1 = new Image();

// image1.crossOrigin = "Anonymous";
//image1.src = "image.jpg";

// image source, the image is converted to base64 url. 
image1.src = 'data:image/jpeg;base64,'

// https://developer.mozilla.org/en-US/docs/Web/API/EventTarget/addEventListener
// add an event to image1 object, which call the function when "load" is finished. 
image1.addEventListener('load',function()
{
    // get the canvas element from the html(called canvas1)
    const canvas = document.getElementById('canvas1');
    // https://developer.mozilla.org/en-US/docs/Web/API/HTMLCanvasElement/getContext
    // get the content from the canvas element. 2d -> a two-dimensional rendering context.
    const ctx = canvas.getContext('2d'); //context

    // set the canvas width(need to match the width in css)
    canvas.width = 1587;
    // set the canvas height(need to match the height in css)
    canvas.height = 2245;
    // https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/drawImage

    // draw the image(image1) to canvas
    ctx.drawImage(image1,0,0,canvas.width,canvas.height);

    /**
     * Below part is changing the image to black and white image. 
     */
    // // https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/getImageData
    // // get the image data(which contains an data array(data) with each element is arranged in (red, green, blue, transparent), and height and width of the image) from canvas context
    // const scannedImage = ctx.getImageData(0,0,canvas.width,canvas.height);
    // // logout the array in console so you can check it. 
    // // console.log(scannedImage);
    // // get the data array(data) with each element is arranged in (red, green, blue, transparent)
    // const scannedData = scannedImage.data;
    // // logout the array in console so you can check it. 
    // // console.log(scannedData);
    // // for every 4 element inside the data array
    // for(let i = 0; i<scannedData.length;i+=4)
    // {
    //     // calculate the total color value of red + gree + blue
    //     const total = scannedData[i]+scannedData[i+1]+scannedData[i+2];
    //     // devide the total value by 3 to get the average color value
    //     const averageColorValue = total/3;
    //     // assign average color value to each color to make it a black and white image. 
    //     scannedData[i]=averageColorValue;
    //     scannedData[i+1]=averageColorValue;
    //     scannedData[i+2]=averageColorValue;
    // }
    // // put changed data back to the image data(which also contains height and width of the image).
    // scannedImage.data = scannedData;
    // // https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/putImageData
    // // put the image data back to the canvas context. 
    // ctx.putImageData(scannedImage,0,0);
    
    // a particles array to store each particale.
    let particlesArray = [];
    // the total number of particles will display
    const numberOfParticles = 10000;

    // get the image data(with a data array and a image height and width), in full canvas size
    const pixels = ctx.getImageData(0,0,canvas.width,canvas.height);
    // clean the canvas(rectangle) since we already get the data we need. (we don't keep the original image inside the canvas)
    ctx.clearRect(0,0,canvas.width,canvas.height);


    // a mapped image(3d array) resturcture the original image data to [height][width][cell data]
    let mappedImage = [];
    // initialize the mapped image array
    // for every height of the image
    for(let y =0;y<canvas.height;y++)
    {
        // a row[2d array] store the [width][cell data]
        let row = [];
        // for evert=y width of the image
        for(let x = 0;x < canvas.width;x++)
        {
            // get red color value from original image data.
            const red = pixels.data[(y*4*pixels.width)+(x*4)];
            // get green color value from original image data.
            const green = pixels.data[(y*4*pixels.width)+(x*4+1)];
            // get blue color value from original image data.
            const blue = pixels.data[(y*4*pixels.width)+(x*4+2)];
            // call calculateRelativeBrightness(r,g,b) to calculate the relative brightness of the combination of those color. (the function is just to calculate it more real)
            const brightness = calculateRelativeBrightness (red,green,blue);
            // creat a cell array which only color value or a pixel. 
            const cell=[
                // the calculated brightness of a pixel
                cellBrightness = brightness,
                // the color of the pixel (string)
                cellColor = 'rgb('+red+','+green+','+blue+')',
            ];
            // put the cell data into the row array
            row.push(cell);
        }
        // put the row into the mapped image array
        mappedImage.push(row);
    }

    // // logout the array in console so you can check it. 
    // console.log(mappedImage);


    // Particle class represent each particle we will draw in the canvas. 
    class Particle{
        // constructor function
        constructor(){
            // https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Math/random
            // the x axis(from left to right, start from the top left cornor) value, assign a random value(within the canvas width), so the particle drop from random x location. 
            this.x = Math.random() * canvas.width;
            // the y axis(from top to down, start from the top left cornor) value, assign 0, so the particle drop from top to down. 
            this.y = 0;
            // the speed of the particle(related to the brightness of the cell)
            this.speed = 0;
            // this velocity value will add to speed to give some random to the speed.
            this.velocity = Math.random() * 1;
            // the size of the particle
            this.size = Math.random()*1.5+1;
            // position is used to map the (x,y) location of the particle with the mappedImage[position1][position2]
            // the y position of the particle(index of the mappedImage array has to be integer, aka pixle has to be integer)
            this.position1 = Math.floor(this.y);
            // the x position of the particle(index of the mappedImage array has to be integer, aka pixle has to be integer)
            this.position2 = Math.floor(this.x);
            // the angle of movement. 
            this.angle = 0;
        }

        // update the particle location and speed information
        update(){
            // update the pixel position of according to the new y value
            this.position1 = Math.floor(this.y);
            // update the pixel position of according to the new x value
            this.position2 = Math.floor(this.x);

            // if the current location of the particle inside the canvas(aks, the position index within the mappedImage).
            if((mappedImage[this.position1])&&(mappedImage[this.position1][this.position2]))
            {
                // change the speed of the particle according to the brightness of the cell. 
                this.speed = mappedImage[this.position1][this.position2][0];
            }
            // update the angle of the movement base on current speed
            this.angle+=this.speed/10;


            // calculated the movement(real speed of the particle), adding the changed speed with velocity.
            let movement = (4.5 - this.speed)+this.velocity;

            // update the y value of the particle, with vertical speed and rotate speed
            this.y += movement + Math.sin(this.angle)*3;
            // update the x value of the particle, with  horizontal speed and rotate speed
            this.x += movement + Math.cos(this.angle)*3;
            // if the particle is moved down out of the canvas, move it to the top of the canvas with a random x location. 
            if(this.y >= canvas.height)
            {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
            // if the particle is moved right out of the canvas, move it to the left of the canvas with a random y location. 
            if(this.x >= canvas.width)
            {
                this.x = 0;
                this.y = Math.random() * canvas.height;
            }
        }

        // draw the particle to the canvas
        draw(){
            // https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/beginPath
            // The beginPath() method begins a path, or resets the current path.
            ctx.beginPath();
            // if the current location of the particle inside the canvas(aks, the position index within the mappedImage).
            if((mappedImage[this.position1])&&(mappedImage[this.position1][this.position2]))
            {
            // https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/fillStyle
            // The fillStyle property sets or returns the color, gradient, or pattern used to fill the drawing.
            // set to the pixel color.
            ctx.fillStyle = mappedImage[this.position1][this.position2][1];
            }
            // https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/arc
            // The arc() method creates an arc/curve (used to create circles, or parts of circles).
            ctx.arc(this.x,this.y,this.size,0,Math.PI*2);
            // https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/fill
            // The fill() method fills the current drawing (path). The default color is black.
            ctx.fill();
        }
    }

    // initialize function initialize the particlesArray with bunch of Particle object.
    function init(){
        for(let i =0; i<numberOfParticles;i++)
        {
            particlesArray.push(new Particle());
        }
    }
    // initialize the particlesArray
    init();

    // animate function animate everything, 
    function animate(){
        // draw the image in the background
        // ctx.drawImage(image1,0,0,canvas.width,canvas.height);
        // https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/globalAlpha
        // set a transparency to every thing that gonna draw
        ctx.globalAlpha = 0.05;
        // https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/fillStyle
        // The fillStyle property sets or returns the color, gradient, or pattern used to fill the drawing.
        ctx.fillStyle = 'rgb(0,0,0)';
        // https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/fillRect
        // draws a rectangle that is filled according to the current fillStyle.
        ctx.fillRect(0,0,canvas.width,canvas.height);
        // https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/globalAlpha
        // set a transparency to every thing that gonna draw
        ctx.globalAlpha = 0.2;
        // for every particle inside the particlesArrays
        for(let i =0;i<particlesArray.length;i++)
        {
            // update the particle location and speed information
            particlesArray[i].update();
            // set a transparency to every thing that gonna draw
            ctx.globalAlpha = particlesArray[i].speed*0.5;
            // draw the particle to the canvas
            particlesArray[i].draw();
        }
        // https://developer.mozilla.org/en-US/docs/Web/API/window/requestAnimationFrame
        // http://www.javascriptkit.com/javatutors/requestanimationframe.shtml
        // we call this function the draw the next frame when " the screen is ready to accept the next screen repaint"
        // this recursive make sure the animation keeps going on. 
        requestAnimationFrame(animate);
    }
    // start the animation 
    animate();

    // calculateRelativeBrightness function calculate the relative brightness of a color in a more realistic way. 
    function calculateRelativeBrightness(red,green,blue){
        return Math.sqrt(
            (red * red) *0.299 +
            (green * green) *0.587 +
            (blue * blue) * 0.114
        )/100;
    }
})